import React from 'react';
import logo from './logo.svg';
import './App.css';
import SearchComponent from "./components/SearchComponent";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";
import Home from "./Home";

function App() {
  return (
      <Router>
          <div>
              <nav>
                  <li>
                      <Link to={"/"}>Home</Link>
                  </li>
                  <li>
                      <Link to={"/search"}>Search</Link>
                  </li>
              </nav>

              <Switch>
                  <Route path={"/search"}>
                      <SearchComponent/>
                  </Route>
                  <Route path={"/"}>
                      <Home/>
                  </Route>
              </Switch>
          </div>
      </Router>
  );
}

export default App;
